function checklose () {
    if (mySprite.overlapsWith(myEnemy)) {
        music.powerDown.play()
        info.changeLifeBy(-20)
    }
    if (info.life() < 0) {
        music.powerDown.play()
        game.over(false, effects.starField)
    }
}
function checkwin () {
    if (50 < coins) {
        game.over(true, effects.confetti)
    }
}
function hitobstacle () {
    if (mySprite.overlapsWith(obstacle1)) {
        info.changeLifeBy(-1)
        mySprite.y += 20
    }
    if (mySprite.overlapsWith(obstacle2)) {
        info.changeLifeBy(-1)
        mySprite.y += 20
    }
    if (mySprite.overlapsWith(obstacle3)) {
        info.changeLifeBy(-1)
        mySprite.y += 20
    }
}
function edgeofscreen () {
    if (mySprite.y < 0) {
        mySprite.y = 0
    }
    if (mySprite.y > 120) {
        mySprite.y = 120
    }
}
function scenery_loop () {
    if (obstacle2.x < 0) {
        obstacle2.x = 160
        obstacle2.y = Math.randomRange(0, 115)
        LEVEL += 1
    }
    if (obstacle3.x < 0) {
        obstacle3.x = 160
        obstacle3.y = Math.randomRange(0, 115)
    }
    if (obstacle1.x < 0) {
        obstacle1.x = 160
        obstacle1.y = Math.randomRange(0, 115)
    }
    if (coin.x < 0) {
        coin.x = 160
        coin.y = Math.randomRange(0, 115)
    }
}
function sceneryMoveLeft () {
    obstacle1.x += 0 - Math.sqrt(LEVEL)
    obstacle2.x += 0 - Math.sqrt(LEVEL)
    obstacle3.x += 0 - Math.sqrt(LEVEL)
    coin.x += 0 - Math.sqrt(LEVEL)
}
function collectCoins () {
    if (mySprite.overlapsWith(coin)) {
        info.changeLifeBy(LEVEL)
        music.baDing.play()
        coin.setPosition(155, Math.randomRange(0, 115))
    }
}
